import React from 'react';

class DynamicComponent extends React.Component {

    render() {
        return (
            <div>
                {this.props.option.name}
            </div>
        );
    }
}

DynamicComponent.propTypes = {
    option: React.PropTypes.object
}

module.exports = {
    "DynamicComponent": DynamicComponent
}
